import { library } from '@fortawesome/fontawesome-svg-core';
import {
  faLaptopCode,
  faLevelDownAlt,
  faTimes,
  faExternalLinkAlt,
} from '@fortawesome/free-solid-svg-icons';

import {
  faGithub,
  faLinkedin,
} from '@fortawesome/free-brands-svg-icons';

library.add(
  faLaptopCode,
  faLevelDownAlt,
  faTimes,
  faGithub,
  faExternalLinkAlt,
  faLinkedin
);

export default { library };
